import React from 'react';
import Esp1 from '../../components/info/Esp1';
import Graph from '../../components/graphe/Graph';
import "./home.css";

function Home({accessToken}) {
    
    return (
        
        <div className="home">            
            <Esp1 accessToken={accessToken}/>
            <Graph accessToken={accessToken}/>
        </div>
    )
}

export default Home
